@prefix : <http://www.semanticweb.org/atm#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ATM rdf:type owl:Class .

:PINVerification rdf:type owl:Class ;
                 rdfs:subClassOf [
                   rdf:type owl:Restriction ;
                   owl:onProperty :hasPart ;
                   owl:someValuesFrom :PIN
                 ].

:DispenseCash rdf:type owl:Class ;
              rdfs:subClassOf [
                rdf:type owl:Restriction ;
                owl:onProperty :precededBy ;
                owl:someValuesFrom :PINVerification
              ].

:User rdf:type owl:Class .

:PIN rdf:type owl:Class ;
     rdfs:subClassOf [
       rdf:type owl:Restriction ;
       owl:onProperty :belongsTo ;
       owl:someValuesFrom :User
     ].

:hasPart rdf:type owl:ObjectProperty .

:belongsTo rdf:type owl:ObjectProperty .

:precededBy rdf:type owl:ObjectProperty .
